import React from 'react';
import './LandingPage.css';

const LandingPage = () => {
    return (
        <div className='main-container'>
            <nav>
                <div>
                    <p>Blog</p>
                    <p>Meal Plans</p>
                    <p>Recipes</p>
                </div>
                <img src = "https://res.cloudinary.com/dujmpn87j/image/upload/v1730144316/Bright_Colorful_Playful_Funny_Donuts_Food_Circle_Logo_processed_yb2a5y.png"/>
                <div>
                    <p>About Us</p>
                    <p>Contact Us</p>
                    <p>Get Started</p>
                </div>
            </nav>
            <h1>Welcome to Meal Planning App...Savvy Eats!!!</h1>
            <p>Plan your meals efficiently and stay healthy!</p>
        </div>
    );
};

export default LandingPage;
